import '../../domain/entities/user_entities.dart';class ProfileModel extends UserEntity {  ProfileModel({    this.id,    this.displayName,    this.username,    this.roles,    this.active,    this.experienceYears,    this.address,    this.level,    this.createdAt,    this.updatedAt,    this.v,  }) : super(          id: id,          displayName: displayName,          username: username,          experienceYears: experienceYears,          address: address,          level: level,        );  ProfileModel.fromJson(dynamic json) {    id = json['_id'];    displayName = json['displayName'];    username = json['username'];    roles = json['roles'] != null ? json['roles'].cast<String>() : [];    active = json['active'];    experienceYears = json['experienceYears'];    address = json['address'];    level = json['level'];    createdAt = json['createdAt'];    updatedAt = json['updatedAt'];    v = json['__v'];  }  @override  String? id;  @override  String? displayName;  @override  String? username;  List<String>? roles;  bool? active;  @override  num? experienceYears;  @override  String? address;  @override  String? level;  String? createdAt;  String? updatedAt;  num? v;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['_id'] = id;    map['displayName'] = displayName;    map['username'] = username;    map['roles'] = roles;    map['active'] = active;    map['experienceYears'] = experienceYears;    map['address'] = address;    map['level'] = level;    map['createdAt'] = createdAt;    map['updatedAt'] = updatedAt;    map['__v'] = v;    return map;  }}